import React, { Component } from 'react';
import Recipe from "./Recipe"
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.somefunc = this.somefunc.bind(this)
  }
  somefunc(){
  }

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <section id = "Header">
            <section id = "Recipes">
                <div style={{ display: "grid", gridTemplateColumns: "repeat(3, 1fr)", gridGap: 60 }}>
                  <div>Column 1</div>
                  <div>Column 2</div>
                  <div>Column 3</div>
                </div>
                <Recipe
                somefunc = {this.somefunc} 
                />
            </section>
          </section>
        </header>
      </div>
    );
  }
}
export default App;
